// reformat return object
// creates keys for each collection and the mapping table for each
function reformat (collections) {
    let reformatCount = 0
    // iterate through each collection
    for (let i = 0; i < collections.length; i++) {
        reformatCount++;
        let obj = collectionsClean[collections[i].categoryId]
        obj = shell;
        let nameObj = {"name": collections[i].name}
        let newObj = Object.assign({}, obj, nameObj);
        collectionsClean[collections[i].categoryId] = newObj;
    }
    return collectionsClean
}

function createMatrix (collectionsClean) {
    let createMatrixCount = 0;
    Object.keys(collectionsClean).forEach(key => {
        createMatrixCount++
        let categoryType = identifyCategory(collectionsClean[key])
        if (categoryType) {
            collectionsClean[key].mapping = masterMap[categoryType].mapping;
            collectionsClean[key].categorization = masterMap[categoryType].categorization;
           // console.log(collectionsClean[key]);
        } else {
            collectionsClean[key].mapping = masterMap.bestSellers.mapping;
            collectionsClean[key].categorization = masterMap.bestSellers.categorization;
           //console.log(collectionsClean[key]);   
        }   
    })
    return collectionsClean;
}

function identifyCategory (collectionObj) {
    let nameRaw = collectionObj.name.split(" ");
    let category = null;
    for (let i = 0; i < nameRaw.length; i++) {
        category = categoryCheck(nameRaw[i].toLowerCase());
        if (category !== undefined) {
            return category
        }
    }

}

